import React, { useContext, useEffect, useState } from "react";
import { Link, useParams } from "react-router-dom";
import { Context } from "../Context";
import Navbar from "../Navbar";
import Loading from "./Loading";
import { makeStyles } from "@material-ui/core/styles";
import Accordion from "@material-ui/core/Accordion";
import AccordionSummary from "@material-ui/core/AccordionSummary";
import AccordionDetails from "@material-ui/core/AccordionDetails";
import Checkbox from "@material-ui/core/Checkbox";
import FormControlLabel from "@material-ui/core/FormControlLabel";
import Typography from "@material-ui/core/Typography";
import ExpandMoreIcon from "@material-ui/icons/ExpandMore";
import Box from "@material-ui/core/Box";

const useStyles = makeStyles({
  root: {
    width: "100%",
  },
  header: {
    backgroundColor: theme.palette.background.paper,
    padding: theme.spacing(2, 2, 2, 2),
  },
});

function Tenant() {
  //get tenantid from url
  const { tenantId } = useParams();
  //tenant state
  const [tenantState, setTenantState] = useState();
  //Context: getUserInfo method
  const { getUserInfo } = useContext(Context);

  const classes = useStyles();

  useEffect(() => {
    getUserInfo(tenantId)
      .then((response) => {
        console.log(response);
        setTenantState(response.data);
      })
      .catch(() => {
        console.log("Failed to retrieve tenant info");
      });
  }, []);

  return (
    <div>
      {tenantState ? (
        <div className="tenant-page">
          <Navbar />
          <Box className={classes.header} textAlign="center">
            <Typography variant="h5">
              {tenantState.store_name} F&B Checklist
            </Typography>
          </Box>
          <div className="tenant-container">
            <div>View Chat</div>
            <div>View Previous Audits</div>
            <Accordion>
              <AccordionSummary
                expandIcon={<ExpandMoreIcon />}
                aria-label="Expand"
                aria-controls="additional-actions1-content"
                id="additional-actions1-header"
              >
                <FormControlLabel
                  aria-label="Acknowledge"
                  onClick={(event) => event.stopPropagation()}
                  onFocus={(event) => event.stopPropagation()}
                  control={<Checkbox />}
                  label="I acknowledge that I should stop the click event propagation"
                />
              </AccordionSummary>
              <AccordionDetails>
                <Typography color="textSecondary">
                  The click event of the nested action will propagate up and
                  expand the accordion unless you explicitly stop it.
                </Typography>
              </AccordionDetails>
            </Accordion>
            <Accordion>
              <AccordionSummary
                expandIcon={<ExpandMoreIcon />}
                aria-label="Expand"
                aria-controls="additional-actions2-content"
                id="additional-actions2-header"
              >
                <FormControlLabel
                  aria-label="Acknowledge"
                  onClick={(event) => event.stopPropagation()}
                  onFocus={(event) => event.stopPropagation()}
                  control={<Checkbox />}
                  label="I acknowledge that I should stop the focus event propagation"
                />
              </AccordionSummary>
              <AccordionDetails>
                <Typography color="textSecondary">
                  The focus event of the nested action will propagate up and
                  also focus the accordion unless you explicitly stop it.
                </Typography>
              </AccordionDetails>
            </Accordion>
            <Accordion>
              <AccordionSummary
                expandIcon={<ExpandMoreIcon />}
                aria-label="Expand"
                aria-controls="additional-actions3-content"
                id="additional-actions3-header"
              >
                <FormControlLabel
                  aria-label="Acknowledge"
                  onClick={(event) => event.stopPropagation()}
                  onFocus={(event) => event.stopPropagation()}
                  control={<Checkbox />}
                  label="I acknowledge that I should provide an aria-label on each action that I add"
                />
              </AccordionSummary>
              <AccordionDetails>
                <Typography color="textSecondary">
                  If you forget to put an aria-label on the nested action, the
                  label of the action will also be included in the label of the
                  parent button that controls the accordion expansion.
                </Typography>
              </AccordionDetails>
            </Accordion>
            <Link to={`/tenant/fbChecklist/${tenantId}`}>Conduct Audit</Link>
          </div>
        </div>
      ) : (
        <Loading />
      )}
    </div>
  );
}

export default Tenant;
